import "./Dashboard.css";
import bell from "./assets/bell.png";
import julaina from "./assets/julaina.png";
function Dashboard() {
    return (
        <>
        <header>
            <t3>Dashboard</t3>
            <img src={bell}></img>
            <img src={juliana}></img>
        </header>
        <body></body>
        </>
    );
}

export default Dashboard;
